import React, {Component} from "react";

class Entrada extends Component{
  render(){
    return(
      <section className="entrada-container">
        <h1 className="entrada-titulo">To Do List</h1>
        <div className="entrada-input-wrap">
          <input className="entrada-input" type="text" />
          <button className="entrada-adiciona" type="button">Adicionar</button>
        </div>
      </section>
    );
  }
}

export default Entrada;
